import React from "react";

function About(){
    return(
        <div class="container">
            <div class="text">
                <h1>About Us</h1>
                <h2>Explore All Corners of<br />
                    The World With Us</h2>
                <p>Far far away, behind the word mountains, far from the countries Vokalia and Consonantia, there live the blind texts.<br /> 
                Separated they live in Bookmarksgrove right at the coast of the Semantics, a large language ocean.<br /> 
                    A small river named Duden flows by their place and supplies it with the necessary regelialia.<br /> 
                    It is a paradisematic country, in which roasted parts of sentences fly into your mouth.</p>
            </div>
            <div class="image1">
                <img src ="https://images.pexels.com/photos/2675268/pexels-photo-2675268.jpeg?cs=srgb&dl=pexels-silvia-trigo-2675268.jpg&fm=jpg"  alt=""/>
            </div>
            <div class="image2">
                <img src ="https://shorturl.at/hyA13"  alt=""/>
            </div>
        </div>
    );
}

export default About;
